import Item from "./item"

const List = ({ data, setData, rerenderStatus }) => {
    let list = Array.from(data);
    list.sort((a,b)=> {
        let [ay,am,aday] = a.date.split("-");
        let [by,bm,bday] = b.date.split("-");
        return new Date(by,bm,bday) - new Date(ay,am,aday);
    });
    return (
        <div className="list">
            {list.map((item) => {
                const { title, date, note, id} = item;
                return (
                    <Item 
                    key={id}
                    id={id}
                    title={title}
                    date={date}
                    note={note}
                    setData={setData}
                    rerenderStatus={rerenderStatus}
                    />
                )
            })}
        </div>

    )
}

export default List;
